import './App.css';
import React from 'react';
import logo from './logo.svg';
import { Header } from './components/Header/Header';
import { UserForm } from './components/Forms/UserForm';
import { PetsCard } from './components/PetsCards/PetsCards';
import categories from './components/Data/PetsCategories'
import catIcon from "./images/cat20-128.webp"
import ReactDOM from "react-dom";
import {
   Router,
  Switch,
  Route,
  useParams
} from "react-router-dom";
import { createBrowserHistory } from 'history';

export const history = createBrowserHistory();

function App() {
  return (
    <div className="App">
      <Router history={history}>
    <Switch>
      <Route exact path="/" component={UserForm}>
      </Route>
      <Route exact path="/categories">
        <Header>Choose a survey to get started</Header>
          <div className="flex flex-row flex-wrap justify-center mt-16">
              {categories && categories.map((element:any, i:any)=>
              <div key={i}>
                <PetsCard imgSrc={element.ImgSrc} imgAlt={element.ImgAlt} ></PetsCard>
              </div>
            )}
          </div>
      </Route>
    </Switch>
  </Router>     
    </div>
  );
}

export default App;
